import React, { useState, useEffect } from 'react';

const PairingHistory = () => {
  const [history, setHistory] = useState([]);

  useEffect(() => {
    // Mock fetching pairing history
    setHistory([
      { student1: 'Alice', student2: 'Bob', date: '2024-11-01' },
      { student1: 'Charlie', student2: 'David', date: '2024-11-05' },
    ]);
  }, []);

  return (
    <div>
      <h2>Pairing History</h2>
      <ul>
        {history.map((pair, index) => (
          <li key={index}>
            {pair.student1} & {pair.student2} - {pair.date}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default PairingHistory;
